import React, { Component } from "react";

class SignInForm extends Component {
  state = {};
  render() {
    return (
      <div className="FormCenter">
        <h1>Home</h1>
        <h2>Question:</h2>
        <ul>
          <li>Where is your home?</li>
          <li>How many houses are there in your home?</li>
          <li>What are the houses made of?</li>
          <li>What are there in your home too?</li>
          <li>How is the place your home?</li>
        </ul>
        <h2>Answer:</h2>
        <p>
          My home is the place of Mahamuni Pahartali in the district of
          Chittagong. It is a nice home at the foot of the hill. There are four
          huts in our home. They are the buildings and the kitchen and the
          cow-shed are thatched huts. There is no garden of fruit: but here are
          fruit-trees here and there on my home premises. The home has no flower
          garden but it has a kitchen garden. There is a pond in two west of the
          home. My home is a nice place indeed. It is very dear to me.
        </p>
      </div>
    );
  }
}

export default SignInForm;
